INSERT INTO `brands` VALUES (1,'关于我们：品牌介绍','<p><strong>公司简介</strong></p><p>&nbsp; &nbsp; &nbsp; &nbsp; 杭州眼护士数据科技有限公司作为中国青少年视健康倡导者，致力于引领视健康之新风。率先采用最新VR成像技术，结合可穿戴设备，研发出一套专业防控近视的软硬件系统。为各年龄阶层提供包括运动健眼、营养恢复、健康理念塑造等多元化服务，用科技的力量给使用者带来不曾有过的视觉新体验！</p><p><strong>产品原理</strong></p><p>眼护士利用VR成像原理，实现100米的视距活动范围，360°引导眼球活动，从而让睫状肌得到全方位的有效锻炼。</p><p><strong>产品工艺</strong></p><p>50-71mm瞳距调节，儿童成人皆可使用；</p><p>800度以下近视物距调节，兼容裸眼戴镜；</p><p>六层膜系防蓝光，隔离手机短波光线；</p><p>奶嘴级硅胶面罩，医学头盔标准。&nbsp;</p><p><strong>产品特点</strong></p><p>功能性APP搭载功能性视训视频</p><p>特制高档专业头盔，匹配APP海量适龄片源，全向沉浸锻炼，立解眼肌痉挛！独家内容，从宇宙探索到人文故事，从英语学习到快速记忆，画面极具趣味性，不用家长盯着，孩子主动就会去看！</p><p><br></p>',1,'2018-03-08 21:54:16','2018-07-21 03:52:37',NULL,9,'黄鸣',9,'黄鸣'),(2,'已333','<p><br></p>',0,'2018-03-10 10:37:02','2018-07-21 03:52:42','2018-07-21 03:52:42',9,'黄鸣',9,'黄鸣');
