--
-- Table structure for table `products`
--

DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `products` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产品名称',
  `cname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '商品副标题',
  `dname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '商品短标题',
  `img_main` text COLLATE utf8mb4_unicode_ci COMMENT '产品主图',
  `img_design` text COLLATE utf8mb4_unicode_ci COMMENT '产品图片',
  `price` decimal(64,2) unsigned DEFAULT '0.00' COMMENT '产品价格',
  `oprice` decimal(64,2) DEFAULT '0.00' COMMENT '原价',
  `cprice` decimal(64,2) DEFAULT '0.00' COMMENT '成本价',
  `region` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '产地',
  `is_showQty` int(255) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '文字描述',
  `status` tinyint(255) DEFAULT '1' COMMENT '状态1为上架2为下架',
  `sort` int(11) unsigned DEFAULT '0' COMMENT '销售量',
  `product_category_id` int(10) unsigned DEFAULT NULL,
  `is_hot` tinyint(255) unsigned NOT NULL DEFAULT '0' COMMENT '是否热销',
  `is_new` tinyint(255) unsigned NOT NULL DEFAULT '0' COMMENT '是否新品',
  `keysname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '商品关键字',
  `superior2` int(255) unsigned NOT NULL DEFAULT '0' COMMENT '二级推荐人分配比例',
  `superior3` int(255) unsigned NOT NULL DEFAULT '0' COMMENT '三级推荐人分配比例',
  `superior1` int(255) unsigned NOT NULL DEFAULT '0' COMMENT '一级推荐人分配比例',
  `introduce` text COLLATE utf8mb4_unicode_ci COMMENT '介绍',
  `is_real` tinyint(2) DEFAULT '0',
  `is_rebate` tinyint(2) NOT NULL DEFAULT '0',
  `rebate_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '分配模式 ',
  `type` int(11) DEFAULT '1' COMMENT '商品种类1:实体物品2:虚拟物品3:虚拟物品(卡密)4:批发商品5:计时/次商品6:树苗',
  `presell_on` tinyint(3) DEFAULT '1' COMMENT '是否预售0:不预售1:预售',
  `details` tinyint(3) unsigned zerofill DEFAULT '000' COMMENT '详情显示首图0:不显示1:显示',
  `fullpiece` tinyint(11) DEFAULT NULL COMMENT '满件包邮    大于该字段的值时包邮,小于该字段的值时不包邮',
  `sales` tinyint(3) unsigned zerofill DEFAULT '000' COMMENT '显示销量0:不显示1:显示',
  `envelope` decimal(64,2) DEFAULT NULL COMMENT '满额包邮    大于该字段时包邮,小于该字段时不包邮',
  `freight` decimal(64,2) DEFAULT '0.00' COMMENT '运费',
  `support` tinyint(3) DEFAULT '1' COMMENT '支持收银台  0:不支持1:支持',
  `cash` tinyint(3) DEFAULT '1' COMMENT '支持货到付款  0:支持1:不支持',
  `invoice` tinyint(3) DEFAULT '1' COMMENT '支持发票 0:支持1:不支持',
  `is_show_main` tinyint(3) DEFAULT '1' COMMENT '主商城搜索结果中 是否显示该商品  0:不显示1:显示',
  `is_back` tinyint(3) DEFAULT '1' COMMENT '是否支持退换货  0:不支持1:支持',
  `confirm` tinyint(3) DEFAULT '7' COMMENT '确认收货时间',
  `volume` int(11) DEFAULT NULL COMMENT '排序',
  `code` int(255) DEFAULT NULL COMMENT '编码',
  `bar` int(255) DEFAULT NULL COMMENT '条码',
  `weig` int(255) DEFAULT NULL COMMENT '重量',
  `is_subtract` tinyint(3) DEFAULT '1' COMMENT '永不减库存1:拍下减库存2:付款减库存3:永不减库存',
  `on_standards` tinyint(2) DEFAULT '0' COMMENT '是否启用规格(0:否)',
  `qty` int(11) DEFAULT '0',
  `one_max` int(11) DEFAULT '9999999' COMMENT '单次购买最大限制(null不限制)',
  `one_min` int(11) DEFAULT '9999999' COMMENT '单次购买最小限制(null不限制)',
  `max` int(11) DEFAULT '999999' COMMENT '购买最大限制(null不限制)',
  `grade_browse` int(11) DEFAULT '0' COMMENT '会员浏览权限,最低等级(0不限制)',
  `grade_buy` int(11) DEFAULT '0' COMMENT '会员购买权限,最低等级(0不限制)',
  `check` tinyint(3) DEFAULT '1' COMMENT '审核状态',
  `province` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `city` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_sellout` tinyint(3) DEFAULT '0' COMMENT '是否已售罄',
  `in_distribute` tinyint(3) NOT NULL DEFAULT '2',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;
/*!40101 SET character_set_client = @saved_cs_client */;

