DROP TABLE IF EXISTS `stores`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `stores` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `province` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `county` varchar(255) DEFAULT NULL,
  `status` tinyint(255) unsigned NOT NULL DEFAULT '1',
  `balance` decimal(64,2) DEFAULT '0.00',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `lng` decimal(65,6) unsigned NOT NULL DEFAULT '0.000000' COMMENT '经度',
  `lat` decimal(65,6) unsigned NOT NULL DEFAULT '0.000000' COMMENT '纬度',
  `img_avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `img_introduce` mediumtext COMMENT '图片展示',
  `introduce` varchar(255) DEFAULT NULL COMMENT '文字介绍',
